import { AppBar, Box, Container, Toolbar, Typography } from "@mui/material";
import { Link, useNavigate } from 'react-router-dom';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles((theme) => ({
  navbarContainer: {
    backgroundColor: '#fcfcfc',
    color: '#333',
    borderBottom: '1px solid #ddd',
    boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)',
    position: 'sticky', // Agregamos posición sticky
    top: 0, // Aseguramos que esté pegado en la parte superior
    zIndex: 999, // Ajustamos el índice z para asegurar que esté por encima de otros elementos
  },
  // Resto de tu código...
}));

export default function Navbar() {
  const classes = useStyles();
  const navigate = useNavigate();

  return (
    <div className={classes.navbarContainer}>
      <AppBar elevation={0}>
        <Container maxWidth="lg">
          <Toolbar className={classes.navbar}>
            <Typography variant="h6" component={Link} to="/" className={classes.logo}>
              <span className={classes.logoText}>Bio-Inka</span>
            </Typography>
            <Box className={classes.navLinks}>
              {/* Resto de tus enlaces */}
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
    </div>
  );
}
